tables.table_schema:
CREATE TABLE international_students (
    student_id INT PRIMARY KEY,
    student_name VARCHAR(50),
    country VARCHAR(50),
    academic_program VARCHAR(50)
);

CREATE TABLE academic_institutions (
    institution_id INT PRIMARY KEY,
    institution_name VARCHAR(100),
    country VARCHAR(50),
    city VARCHAR(50)
);

CREATE TABLE collaboration_projects (
    project_id INT PRIMARY KEY,
    project_name VARCHAR(100),
    project_description TEXT,
    start_date DATE,
    end_date DATE
);

CREATE TABLE Program_Partnerships (
    partnership_id INT PRIMARY KEY,
    partner_country VARCHAR(50),
    partnership_type VARCHAR(50),
    program_description TEXT
);

CREATE TABLE Courses (
    course_id UUID PRIMARY KEY,
    course_name STRING,
    course_code STRING,
    credits INT
);

CREATE TABLE Countries (
    country_id UUID PRIMARY KEY,
    country_name STRING,
    continent STRING
);
